import React from 'react';
import './AuthStyles.css';

const Scores = () => {
  // Datos de ejemplo, puedes remover estos cuando integres el backend
  const scores = [
    { username: "User1", points: 20 },
    { username: "User2", points: 15 },
    { username: "User3", points: 30 }
  ];

  return (
    <div className="scores-container">
      <h1>Scores</h1>
      <ul>
        {scores.map((score, index) => (
          <li key={index}>{`${score.username}: ${score.points}`}</li>
        ))}
      </ul>
    </div>
  );
};

export default Scores;
